import React, {useState, useEffect} from "react";
import PastCard from "../PastCard";
import { Section } from "./styles";
import getAllLaunches from "../../services/getAllLaunches";

const PastLayout = () => {

const [launches, setlaunches] = useState([{fairings:{ links: { patch: {} } }}]);

useEffect(() => {
  getAllLaunches().then((data) => setlaunches(data));
}, []);
console.log(launches[1])
  return (
    <Section>
      {launches.map((item, index)=>{
        if (index > launches.length-3){

        return (
          <PastCard key={launches.id} title={launches.name} img={launches.links.patch.large}/>
        );
        } 

      })}
    </Section>
  );
};

export default PastLayout;
